import React from 'react';

import '../css/OtpDialog.css';

function OtpDialog() {
    const toggleDivHorizontal = (id, t, openWidth, closeWidth) => {
      let el = document.getElementById(id);
      let width = t ? openWidth : closeWidth;
      el.style.transition = "all 800ms";
      el.style.width = width + 'px';
    }

  return (
      <div className='otp-dialog'>
          <p className='secondary bold'>Enter your OTP</p>
          <div className='flex-row'>
              <input type="number" name="otp" max={9} />
              <input type="number" name="otp" max={9} />
              <input type="number" name="otp" max={9} />
              <input type="number" name="otp" max={9} />
              <input type="number" name="otp" max={9} />
              <input type="number" name="otp" max={9} />
          </div>
          <div className='flex-row jc-sb mt-10'>
            <button className='btn btn-fade btn-small'>Cancel</button>
            <button className='btn btn-primary btn-small'>Verify</button>
          </div>
      </div>
  );
}

export default OtpDialog;
